import React from "react";
import "./Hero.css";

const Hero = () => {
  return (
    <div className="hero-container">
      <div className="background-image"></div>
      <div className="background-overlay"></div>
      <div className="background-ellipse"></div>
      <div className="hero-content">
        <h2 className="hero-heading">Elevate <span className=""></span> Real Estate Success with</h2>
        <h1 className="hero-title">Osumare's Digital Expertise</h1>
        <p className="hero-subtitle">Tailored Solutions for Thriving in the Digital Real Estate Landscape</p>
        <button className="hero-button">Get started</button>
      </div>
    </div>
  );
};

export default Hero;
